-- creating database
create database healthcare;

-- use the database
use healthcare;

-- create tables
-- 1)patient table
create table aaaa11a(
Patient_ID integer auto_increment,
Fisrt_Name varchar(30),
Last_Name varchar(30),
Date_Of_Birth varchar(30),
Gender ENUM("Male","Female"),
Age int,
Blood_Group ENUM('A+', 'A-', 'B+', 'B-', 'AB+', 'AB-', 'O+', 'O-'),
Disease varchar(50),
Admission_Date date,
Status ENUM('Admitted', 'Discharged', 'Under Treatment'),
primary key(Patient_ID)
);

-- insert values into patient table


-- select the records from table
select * from aaaa11a;

-- 2)doctors table
create table zz1(
Doctor_ID integer auto_increment,
First_Name varchar(30),
Last_Name varchar(30),
Specialization varchar(30),
Phone_Number bigint,
Email varchar(100),
Address varchar(200),
Date_Of_Birth date,
Gender ENUM('Male','Female'),
Join_Date date,
Is_Active ENUM('Yes','No'),
primary key(Doctor_ID)
);

